import {GET_DATA_REQUEST, GET_DATA_SUCCESS, GET_DATA_FAILURE} from '../types'
import { createAction } from 'redux-api-middleware';


export const getData = () => (dispatch) => dispatch(createAction({
    endpoint: 'http://localhost:5000',
    method: 'GET',
    types: GET_DATA_SUCCESS
}))
